import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from './components/HomePage';
import CodeCheckerForm from './components/CodeCheckerForm';
import GithubRepoChecker from './components/GithubRepoChecker'; // Assume you have this component

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/check-code" component={CodeCheckerForm} />
        <Route path="/check-repo" component={GithubRepoChecker} />
      </Switch>
    </Router>
  );
}

export default App;
